public synchronized void performOneTick(){
  currentTick++;
  List<ScheduledTask> oldTasks=scheduledTasks.getCurrentTaskList();
  for (  ScheduledTask task : oldTasks) {
    if (task.getScheduledTick() == currentTick && !task.isCancelled()) {
      if (task.isSync()) {
        wrapTask(task).run();
      }
 else {
        pool.submit(wrapTask(task));
        task.submitted();
      }
      if (task instanceof RepeatingTask) {
        if (!task.isCancelled()) {
          repeatingTask.updateScheduledTick();
          scheduledTasks.addTask(task);
        }
      }
 else {
        task.cancel();
      }
    }
  }
}

@Test void registerMultipleTimerTasksAsynchronously(){
  final int toExecute=100;
  final Thread mainThread=Thread.currentThread();
  AtomicInteger executed=new AtomicInteger();
  AtomicBoolean completed=new AtomicBoolean();
  AtomicBoolean notPrimaryThread=new AtomicBoolean();
  Thread thread=new Thread(() -> {
    try {
      for (int i=0; i < toExecute && !Thread.interrupted(); i++) {
        scheduler.runTaskTimer(null,new Consumer<>(){
          int executions=0;
          @Override public void accept(          BukkitTask bukkitTask){
            if (mainThread != Thread.currentThread()) {
              notPrimaryThread.set(true);
            }
            executions++;
            if (executions == toExecute) {
              executed.incrementAndGet();
              bukkitTask.cancel();
            }
          }
        }
,0,1);
      }
    }
  finally {
      completed.set(true);
    }
  }
);
  thread.start();
  long startTime=System.currentTimeMillis();
  while (!completed.get()) {
    checkTimeout(startTime,thread);
    scheduler.performOneTick();
    Thread.yield();
  }
  while (executed.get() < toExecute) {
    checkTimeout(startTime);
    scheduler.performOneTick();
  }
  assertEquals(toExecute,executed.get());
  assertFalse(notPrimaryThread.get());
}

